pragma solidity >=0.7.0 <0.9.0;

contract A{
    function div(int a, int b) public pure returns(int){
        return a/b;
    }
}

library Math{
    function div(int a, int b) public pure returns(int){
        require(b!=0, "the donominator is zero");
    }
}

